def quiz4quiz():
    form=cgi.FieldStorage()
    HTML=Top
    count=0
    total=5
    answer1=form.getvalue("answer1")
    try:
        if answer1.lower()=="scooper" or answer1.lower()=="ice cream scooper":
            count+=1
    except:
        pass
    answer2=form.getvalue("answer2")
    try:
        if answer2.lower()=="aglet":
            count+=1
    except:
        pass
    answer3=form.getvalue("answer3")
    try:
        if answer3.lower()=="magnet":
            count+=1
    except:
        pass
    answer4=form.getvalue("answer4")
    try:
        if answer4.lower()=="snitch" or answer4.lower()=="golden snitch":
            count+=1
    except:
        pass
    answer5=form.getvalue("answer5")
    try:
        if answer5.lower()=="krabby patty":
            count+=1
    except:
        pass
    score=str(count)
    HTML=HTML.replace("??score??", score+'/'+str(total))
    if count/total==1:
        HTML=HTML.replace("??message??", "Great Guessing!")
    elif count/total>=0.6:
        HTML=HTML.replace("??message??", "You Know an Understandable Amount of Objects")
    elif count/total>=0.2:
        HTML=HTML.replace("??message??", "Brush Up on that Dictonary over Yonder")
    else:
        HTML=HTML.replace("??message??", "Go Outside Once in a While")
    HTML+=Bottom
    if form.getvalue("submit")=="Find Out!": 
        print(HTML)
    

